import React, { Component } from 'react'


export function About(props) {
    if (props.about) {
        return null;
    }

    return (
        <div className="about-container">
            <div>
                <img className="avatar inline-block" src="../static/images/Cave_Johnson.png"></img>
            </div>
            <h1>ABOUT</h1>
            
        </div>
    );
}

export default About;
